description:
### Le jeu de données
Il comprend la **liste des producteurs des filières à Responsabilité élargie du producteur (REP) enregistrés dans SYDEREP avec leur identifiant unique (IDU)** conformément à [l’article L. 541-10-13 du Code de l’environnement](https://www.legifrance.gouv.fr/codes/article_lc/LEGIARTI000041583847). Le jeu de données concerne les filières REP : ABJ, ASL, EEE, BPS, DISP-MED, EA, EMPAP, JOUET, LUB, MNU, PA, PCHIM, PMCB, PNEU, TLC, TABAC.
Pour le producteur, l’IDU est la preuve qu’il est bien enregistré au registre pour une filière, conformément à l’article L. 541-10-13 du Code de l'environnement. Pour l’ADEME, il sert à faciliter le suivi et le contrôle du respect des obligations de REP qui incombent à ces producteurs, ainsi qu’à identifier les producteurs en système individuel et les producteurs adhérents à un éco-organisme qui sont éligibles à la redevance annuelle.
Ainsi, pour les filières en vigueur, le vendeur d'un produit relevant du principe de REP peut communiquer à l'acheteur, à la demande de ce dernier, l'IDU sous lequel est enregistré le producteur qui remplit pour ce produit les obligations de REP (cf. [L. 541-10-10](https://www.legifrance.gouv.fr/codes/article_lc/LEGIARTI000041599045) du code de l'environnement).
### Règles d’actualisation des données
Les données sont actualisées à partir des mises à jour effectuées par les éco-organismes sur SYDEREP qui enregistrent leur liste d’adhérents et par les producteurs en système individuel. 
Pour les producteurs en système collectif, la suppression de l’IDU se fait à la seule initiative de l’éco-organisme qui a la responsabilité de cette décision. Cette liste ne reflète pas les producteurs qui ont effectué une déclaration de données sur SYDEREP. 
Point d'attention : l'ouverture du fichier CSV dans Excel peut perturber l'affichage par défaut du SIRET et nécessiter de changer le format d'affichage de la colonne.
<p>
</p>
L’actualisation de cette liste mise à disposition sera réalisée **quotidiennement** sur https://data.ademe.fr.
### Généralités sur les filières REP
L’État a confié à l’ADEME la mise en place et la gestion des registres de déclarations annuelles obligatoires des metteurs sur le marché relevant des filières REP suivantes :
* Article de bricolage et de jardinage (ABJ) ;
* Articles de sport et loisirs (ASL) ;
* Bateaux de plaisance ou de sport (BPS) ;
* Dispositifs Médicaux perforants des patients en auto-traitement (DISP-MED) ;
* Eléments d’ameublement (EA) ;
* Equipements électriques et électroniques (EEE) ;
* Emballages ménagers et papiers graphiques (EMPAP) ;
* Huiles lubrifiantes ou industrielles (LUB) ;
* Jouets (JOUET) ;
* Médicaments non utilisés (MNU) ;
* Piles et accumulateurs (PA) ;
* Pneumatiques (PNEU) ;
* Produits chimiques (PCHIM) ;
* Produits ou matériaux de construction du secteur du bâtiment (PMCB) ;
* Produits du tabac (TABAC) ;
* Textiles d’habillement, linge de maison et chaussures (TLC) ;
* Voitures particulières, camionnettes, véhicules à moteurs à 2 ou 3 roues et quadricycles (VEHICULE).
<p>
</p>
Cette liste va s’enrichir au fur et à mesure de l’entrée en vigueur de la loi AGEC avec les nouvelles filières à venir.
<p>
</p>
Ces registres sont gérés dans l’application [SYDEREP](https://syderep.ademe.fr/), permettant aux éco-organismes ou aux producteurs en système individuel, le renseignement direct de leurs données.
Ces registres ayant pour objet la mesure de la performance globale au niveau national de chacune des filières REP, l’ADEME établit et publie annuellement un état des lieux des filières et différentes publications avec un certain nombre d’indicateurs agrégés, complétés d'éléments d'analyses qualitatives provenant des acteurs de chaque filière.
### Jeux de données disponibles sur les filières REP
Des données issues de ces registres sont aujourd’hui disponibles sur [https://data.ademe.fr](https://data.ademe.fr/) :
* La liste des producteurs enregistrés dans SYDEREP avec leur identifiant unique ;
* La liste des membres adhérents des éco-organismes. La mise à jour de cette liste a lieu une fois par an, en juin de chaque année ;
* Les quantités mises sur le marché pour les filières BPS, DISPMED, EA, EEE, EMBM, LUB, MNU, PA, PAP, PCHIM, PNEU, TABAC et TLC ;
* Les tonnages collectés pour les filières BPS, DISPMED, EA, EEE,MNU, PA, PCHIM, PNEU, TLC et VEHICULE.
* ainsi que certains indicateurs, au fur et à mesure de leur mise à disposition.
<p>
</p>
**Retrouvez l'ensemble des [ressources disponibles des filières REP](https://filieres-rep.ademe.fr/filieres-REP) sur le site dédié [filieres-rep.ademe.fr](https://filieres-rep.ademe.fr/)**
